                    linkCat: 'instrumentos-extra-protocolares-6'
                }
            ]
        }
    ])   


    const dataCurrent = <>
        <div className="header-parent-title">        
            <h2>Escritura pública</h2>
            <a href="#" className="button-detail with-bg-img"></a>
        </div>

        <div className="detail-body">
            <div className="parent-image">                
                <img src={Config.URL + "/img/service-img.jpg?v=2"} className="banner-detail" />
